A very very slow and informative tutorial of one of my most appreciated looks ever! THANKYOU!

First of all, I sincerely apologise for the lighting. I tried my level best but the sun and clouds bailed out on me.

This is a super glam and clearly has a bunch of products and quite a heavy base to it. It’s a personal choice if you need to stick to a heavy base or just your normal routine. Thankyou so much @snehamnj for teaching me the art of glam!
Hope you guys recreate this at some point in your lives and use my hashtag #BlameItOnSim  when you do.

P.S. the video has no filters or colour correction done.
