This was the look I created for the latest #StylingSimphonies that you guys loved! It is a very beautiful but unpredictable Indian glam with a dark eye and dark lip game.

The foundation application is key in this. Remember the formula:

Foundation + Moisturiser + Blended with a small fluffy brush -> soft dewy glam skin!

Shoot your doubts on the comments and let me know if you enjoyed this!
